import React, { useState } from 'react';
import styled from 'styled-components';
import { usePlayer } from '../context/PlayerContext';

const ColoringGame = () => {
  const { updateGameProgress } = usePlayer();
  const [selectedColor, setSelectedColor] = useState(null);
  const [isCorrect, setIsCorrect] = useState(false);
  const [showFeedback, setShowFeedback] = useState(false);

  const colors = [
    { name: '·É¨·Éò·Éó·Éî·Éö·Éò', value: '#FF0000' },
    { name: '·Éö·É£·É†·ÉØ·Éò', value: '#0000FF' },
    { name: '·Éõ·É¨·Éï·Éê·Éú·Éî', value: '#00FF00' }
  ];

  const handleColorSelect = (color) => {
    setSelectedColor(color.value);
    const correct = color.value === '#FF0000';
    setIsCorrect(correct);
    setShowFeedback(true);

    if (correct) {
      updateGameProgress('coloring', Date.now(), { completed: true });
      setTimeout(() => {
        setShowFeedback(false);
      }, 1500);
    }
  };

  return (
    <Container>
      <GameArea>
        <ExampleTitle>·Éú·Éò·Éõ·É£·É®·Éò:</ExampleTitle>
        <HeartContainer>
          {/* ·Éú·Éò·Éõ·É£·É®·Éò - ·É¨·Éò·Éó·Éî·Éö·Éò ·Éí·É£·Éö·Éò */}
          <svg width="200" height="200" viewBox="0 0 100 100">
            <path
              d="M50 80 C 25 60, 0 40, 0 20 C 0 0, 20 0, 25 10 C 30 0, 50 0, 50 20 C 50 0, 70 0, 75 10 C 80 0, 100 0, 100 20 C 100 40, 75 60, 50 80"
              fill="#FF0000"
              stroke="#000000"
              strokeWidth="2"
            />
          </svg>
        </HeartContainer>

        <TaskTitle>·Éí·Éê·Éê·É§·Éî·É†·Éê·Éì·Éî ·Éí·É£·Éö·Éò:</TaskTitle>
        <HeartContainer>
          {/* ·Éí·Éê·É°·Éê·É§·Éî·É†·Éê·Éì·Éî·Éë·Éî·Éö·Éò ·Éí·É£·Éö·Éò */}
          <svg width="200" height="200" viewBox="0 0 100 100">
            <path
              d="M50 80 C 25 60, 0 40, 0 20 C 0 0, 20 0, 25 10 C 30 0, 50 0, 50 20 C 50 0, 70 0, 75 10 C 80 0, 100 0, 100 20 C 100 40, 75 60, 50 80"
              fill={selectedColor || 'transparent'}
              stroke="#000000"
              strokeWidth="2"
            />
          </svg>
        </HeartContainer>

        <ColorsContainer>
          {colors.map((color, index) => (
            <ColorButton
              key={index}
              color={color.value}
              onClick={() => handleColorSelect(color)}
            >
              {color.name}
            </ColorButton>
          ))}
        </ColorsContainer>

        {showFeedback && (
          <Feedback correct={isCorrect}>
            {isCorrect ? '·Éß·Éù·É©·Éê·É¶! ·É°·É¨·Éù·É†·Éê·Éì ·Éí·Éê·Éê·É§·Éî·É†·Éê·Éì·Éî! üéâ' : '·É°·É™·Éê·Éì·Éî ·Éó·Éê·Éï·Éò·Éì·Éê·Éú! ü§î'}
          </Feedback>
        )}
      </GameArea>
    </Container>
  );
};

const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  min-height: 100vh;
  background: linear-gradient(to bottom right, #f0f0f0, #e0e0e0);
`;

const GameArea = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 2rem;
  padding: 2rem;
  background: white;
  border-radius: 20px;
  box-shadow: 0 4px 8px rgba(0,0,0,0.1);
`;

const HeartContainer = styled.div`
  margin: 1rem 0;
`;

const ExampleTitle = styled.h2`
  font-size: 1.5rem;
  color: #333;
`;

const TaskTitle = styled.h2`
  font-size: 1.5rem;
  color: #333;
`;

const ColorsContainer = styled.div`
  display: flex;
  gap: 1rem;
  margin-top: 1rem;
`;

const ColorButton = styled.button`
  padding: 0.8rem 1.5rem;
  border: none;
  border-radius: 8px;
  background: ${props => props.color};
  color: white;
  font-size: 1rem;
  cursor: pointer;
  transition: transform 0.2s;
  text-shadow: 1px 1px 1px rgba(0,0,0,0.5);

  &:hover {
    transform: scale(1.05);
  }
`;

const Feedback = styled.div`
  font-size: 1.5rem;
  color: ${props => props.correct ? '#4CAF50' : '#f44336'};
  text-align: center;
  margin-top: 1rem;
`;

export default ColoringGame;
